public static double parseDouble(@Nullable String str) {
        if (str == null || str.isEmpty()) {
            return Double.NaN;
        } else {
            try {
                return Double.parseDouble(str);
            } catch (NumberFormatException e) {
                Exceptions.report(e);
                return Double.NaN;
            }
        }
    }
